export const CONTRACT_ADDRESS = "0x0000000000000000000000000000000000000000";

export const CONTRACT_ABI = [
  "function electionCount() view returns (uint256)",
  "function totalVotes() view returns (uint256)",
  "function getElection(uint256) view returns (uint256 id, string name, bool isActive, uint256 candidateCount)",
  "function getElectionResults(uint256) view returns (uint256[] ids, string[] names, uint256[] votes, uint256 winnerId)",
  "function admin() view returns (address)"
];
